INSERT INTO `v1_082712c1df16a14103e37b7b58b292f14fbbbeac49744500e8ad77c2b2fc6f2c` VALUES (10001, 2, 1, "ふっふっふ、これでカヤぴぃとボスを見返してやるです！", 1000101, "vo_minigame_1004_top_1_000", "vo_minigame_1004");
INSERT INTO `v1_082712c1df16a14103e37b7b58b292f14fbbbeac49744500e8ad77c2b2fc6f2c` VALUES (10002, 2, 1, "しりとりでの戦い、お兄さんにも手伝ってもらうです", 1000201, "vo_minigame_1004_top_1_003", "vo_minigame_1004");
INSERT INTO `v1_082712c1df16a14103e37b7b58b292f14fbbbeac49744500e8ad77c2b2fc6f2c` VALUES (10003, 1, 2, "どんなケンカも売られた以上は買うのが喧嘩屋だ！やってやるぜ！", 1000301, "vo_minigame_1004_top_1_004", "vo_minigame_1004");
INSERT INTO `v1_082712c1df16a14103e37b7b58b292f14fbbbeac49744500e8ad77c2b2fc6f2c` VALUES (10004, 1, 2, "石板でしりとりか……イノリのヤツおもしろいこと考えるな", 1000401, "vo_minigame_1004_top_1_005", "vo_minigame_1004");
