INSERT INTO `v1_082712c1df16a14103e37b7b58b292f14fbbbeac49744500e8ad77c2b2fc6f2c` VALUES (10007, 2, 3, "ぐもももも（シリトリ タノシイ）", 1000701, "vo_minigame_1004_top_1_008", "vo_minigame_1004");
