INSERT INTO `v1_082712c1df16a14103e37b7b58b292f14fbbbeac49744500e8ad77c2b2fc6f2c` VALUES (10009, 2, 1, "カヤぴぃ相手でも手加減しないです", 1000901, "vo_minigame_1004_top_2_010", "vo_minigame_1004");
INSERT INTO `v1_082712c1df16a14103e37b7b58b292f14fbbbeac49744500e8ad77c2b2fc6f2c` VALUES (10009, 1, 2, "上等だ！やるからには本気で来いよな", 1000902, "vo_minigame_1004_top_2_011", "vo_minigame_1004");
INSERT INTO `v1_082712c1df16a14103e37b7b58b292f14fbbbeac49744500e8ad77c2b2fc6f2c` VALUES (10010, 2, 1, "カヤぴぃ、謝るなら今のうちです", 1001001, "vo_minigame_1004_top_2_012", "vo_minigame_1004");
INSERT INTO `v1_082712c1df16a14103e37b7b58b292f14fbbbeac49744500e8ad77c2b2fc6f2c` VALUES (10010, 1, 2, "イノリこそ泣きを入れるなら今のうちだぜ？", 1001002, "vo_minigame_1004_top_2_013", "vo_minigame_1004");
