INSERT INTO `v1_082712c1df16a14103e37b7b58b292f14fbbbeac49744500e8ad77c2b2fc6f2c` VALUES (10011, 1, 2, "待て！オレがバカみたいにいうな！！", 1001102, "vo_minigame_1004_top_2_015", "vo_minigame_1004");
